import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    users: [
      {
        text: "foo",
        text: "bear",
      },
      {
        text: "foo",
        text: "bear",
      },
      {
        text: "foo",
        text: "bear",
      },
      {
        text: "foo",
        text: "bear",
      },
    ],

    input: "",
  };

  moveToNext = (index) => {
    const users = this.state.users[1];
  };

  render() {
    return (
      <div className="App">
        <div className="container">
          <div>
            <div className="user1">
              <h2 className="name">Winnie</h2>
            </div>
            <List
              blocktext={this.state.users[0].user1}
              moveToNext={this.moveToNext}
            />
          </div>
          <div>
            <div className="user2">
              <h2 className="name">Bob</h2>
            </div>
            <List
              blocktext={this.state.users[1].user2}
              moveToNext={this.moveToNext}
            />
          </div>
          <div>
            <div className="user3">
              <h2 className="name">Thomas</h2>
            </div>
            <List
              blocktext={this.state.users[2].user3}
              moveToNext={this.moveToNext}
            />
          </div>
          <div>
            <div className="user4">
              <h2 className="name">George</h2>
            </div>
            <List
              blocktext={this.state.users[3].user4}
              moveToNext={this.moveToNext}
            />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
